import React from 'react'
import { RoomObj } from '../Types'

type Props = {
    roomData: RoomObj
}

const Room: React.FC<Props> = ({ roomData }) => {
    return (
        <div>
            Room: {roomData === undefined ? '' : roomData.name}
            <br/>
            Id: {roomData === undefined ? '' : roomData.id}
        </div>
    )
}

export default Room
